// App.js
import React from 'react';
import '../App.css';
import Header from "./Header";
import SearchBar from './SearchBar';
import Categories from './Categories';
import ItemList from './ItemList';
import { useLocation } from 'react-router-dom';

function Marketplace() {
  const location=useLocation();
  const { yourName, productName, actualPrice, sellingPrice, brand ,item} = location.state || {};
  return (
    <div className="App">
      <Header />
      <SearchBar />
      <Categories />
      <ItemList yourName={yourName} productName={productName} actualPrice={actualPrice} sellingPrice={sellingPrice} brand={brand} image={item ? item.image : undefined}/>
    </div>
  );
}

export default Marketplace;


